import React, { Component } from 'react';
import { ClientData } from 'shared/api/clientData';
import { CommonTable } from 'components/watchlist/table';

export class Dashboard extends Component {

    constructor() {
        super();
        this.state = {
            data: this.data(),
        }
    }

    data = () => {
        ClientData.handleDataRequests()
            .then((data) => {
                this.props.setDisplayData(data);
            });
    }

    render() {

        const {
            cardView,
            displayedData,
            productType,
            tableView,
            realImages,
            sortDirection,
            demoMode,
        } = this.props;

        return (
            <CommonTable data={this.state.data}/>
        );
    }
}
